    t[7] = "\u0641\u0642\u0637 \u067e\u0648\u0631\u062a 4444 127.0.0.1 (\u06cc\u0627 \u0644\u0648\u06a9\u0627\u0644 \u0647\u0627\u0633\u062a) \u0631\u0627 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u067e\u0631\u0648\u06a9\u0633\u06cc http \u062f\u0631 \u062a\u0646\u0638\u06cc\u0645\u0627\u062a \u0645\u0631\u0648\u0631\u06af\u0631 \u062e\u0648\u062f \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.";
    t[10] = "Please {0}have patience{1} as I2P+ boots up and finds peers.";
    t[11] = "\u0644\u0637\u0641\u0627\u064b {0}\u0635\u0628\u0648\u0631 \u0628\u0627\u0634\u06cc\u062f{1} \u0632\u06cc\u0631\u0627 I2P \u0631\u0627\u0647\u200c\u0627\u0646\u062f\u0627\u0632\u06cc \u0645\u06cc\u200c\u0634\u0648\u062f \u0648 \u0647\u0645\u062a\u0627\u06cc\u0627\u0646 \u062e\u0648\u062f \u0631\u0627 \u067e\u06cc\u062f\u0627 \u0645\u06cc\u200c\u06a9\u0646\u062f.";
